`,paraId:174,tocIndex:158},{value:"POST ",paraId:175,tocIndex:159},{value:"https://api.zan.top/node/v1/eth/mainnet/{apiKey}",paraId:175,tocIndex:159},{value:"Returns an array of all logs that match the filter with a given ID.",paraId:176,tocIndex:160},{value:"The filter expires if it remains inactive (no queries) for 5 minutes.",paraId:177,tocIndex:161},{value:`
